import logo from '../../images/logo.svg'
import { Route, Link, Routes } from "react-router-dom";


export default function Header({ email, handleSignOut }) {
  return(
    <header className="header">
      <a href="/"><img
        src={logo}
        className="header__logo"
        alt="Логотип проекта"
      /></a>

      <Routes>


      </Routes>


    </header>
  )
}
